import React from 'react';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '10px',
    width: '100%',
    boxSizing: 'border-box',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '40px',
    width: '100%',
    boxSizing: 'border-box',
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  aboutSection: {
    marginTop: '20px',
    marginBottom: '75px',
    textAlign: 'left',
    paddingLeft: '20px',
  },
  introductionHeading: {
    fontSize: '2rem',
    fontWeight: 'bold',
    color: '#333',
  },
  introductionContent: {
    fontSize: '1.2rem',
    color: '#555',
  },
  ourWorksSection: {
    marginTop: '50px', // Adjusted margin top
    marginBottom: '75px',
    width: '80%',
    display: 'flex',
    flexDirection: 'column', // Changed to column layout
    alignItems: 'center', // Center items horizontally
  },
  ourWorksHeading: {
    fontSize: '2rem',
    fontWeight: 'bold',
    marginBottom: '20px', // Added margin bottom
    color: '#333',
  },
  imageBlockContainer: {
    display: 'flex',
    justifyContent: 'center', // Center items horizontally
    flexWrap: 'wrap',
  },
  imageBlock: {
    width: '30%',
    marginBottom: '20px',
    boxSizing: 'border-box',
  },
  image: {
    width: '100%',
    height: 'auto',
  },
};

const Header = () => (
  <header style={styles.header}>
    {/* Removed website name */}
  </header>
);

const NavBar = () => (
  <nav style={styles.nav}>
    <div style={styles.logo}>Logo</div>
    <ul style={styles.navUl}>
      <li style={styles.navLi}>Home</li>
      <li style={styles.navLi}>Our Missions</li>
      <li style={styles.navLi}>About Us</li>
      <li style={styles.navLi}>Clubs</li>
      <li style={styles.navLi}>Contact Us</li>
    </ul>
    <div style={styles.loginButton}>Login</div>
  </nav>
);

const AboutSection = () => (
  <div style={styles.aboutSection}>
    <div>
      <h1 style={styles.introductionHeading}>Introduction</h1>
      <p style={styles.introductionContent}>This is the introduction</p>
    </div>
  </div>
);

const ImageBlock = ({ src, alt }) => (
  <div style={styles.imageBlock}>
    <img src={src} alt={alt} style={styles.image} />
  </div>
);

const OurWorksSection = () => (
  <div style={styles.ourWorksSection}>
    <h2 style={styles.ourWorksHeading}>Our Works</h2>
    <div style={styles.imageBlockContainer}>
      <ImageBlock src="https://via.placeholder.com/600x400" alt="Image 1" />
      <ImageBlock src="https://via.placeholder.com/600x400" alt="Image 2" />
      <ImageBlock src="https://via.placeholder.com/600x400" alt="Image 3" />
      <ImageBlock src="https://via.placeholder.com/600x400" alt="Image 4" />
      <ImageBlock src="https://via.placeholder.com/600x400" alt="Image 5" />
      <ImageBlock src="https://via.placeholder.com/600x400" alt="Image 6" />
    </div>
  </div>
);

const App = () => (
  <div style={styles.app}>
    <Header />
    <NavBar />
    <AboutSection />
    <OurWorksSection />
    {/* Include other components and sections as needed */}
  </div>
);

export default App;
